css:
.github-StubItem-git-tab-controller {
  flex: 1;
  display: flex;
}
.github-PanelEtchWrapper {
  flex: 1;
  display: flex;
  min-width: 0;
}
.github-Panel {
  flex: 1;
  display: flex;
  flex-direction: column;
  min-width: 0;
  font-family: '.SFNSText-Regular', 'SF UI Text', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: 12px;
  color: #d4d73d;
  -webkit-user-select: none;
  cursor: default;
}
.github-Panel.no-repository {
  padding: 30px;
  text-align: center;
}
.github-Panel.is-loading {
  color: #e6e6e6;
}
.github-Panel.no-repository {
  display: flex;
  justify-content: center;
  font-size: 1.25em;
}
.github-Panel.no-repository > * {
  margin: 10px 0;
}
.github-Panel.no-repository .git-logo-path {
  fill: #4c4d18;
}
atom-dock.bottom .github-Panel {
  flex-direction: row;
}
atom-dock.bottom .github-StagingView {
  flex-direction: row;
  flex: 2;
}
atom-dock.bottom .github-StagedChanges {
  border-left: 1px solid #141414;
  border-right: 1px solid #141414;
}
atom-dock.bottom .github-StagingView-group:first-child .github-StagingView-header {
  border-top: 1px solid #141414;
}
atom-dock.bottom .github-CommitView {
  flex: 1;
}
